import React, { useState } from "react";

function Nahodka() {
  const [foundAnimalData, setFoundAnimalData] = useState({
    description: "",
    location: "",
    file: null,
    fileName: ""
  });

  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      setFoundAnimalData({
        ...foundAnimalData,
        file: file,
        fileName: file.name
      });
    }
  };

  const handleSubmit = () => {
    if (!foundAnimalData.description.trim()) {
      alert("Пожалуйста, введите описание");
      return;
    }

    setIsSubmitting(true);

    // Имитация отправки данных
    setTimeout(() => {
      alert(`Сообщение о находке отправлено!\n\nОписание: ${foundAnimalData.description}\nФайл: ${foundAnimalData.fileName || "не загружен"}`);
      setFoundAnimalData({
        description: "",
        location: "",
        file: null,
        fileName: ""
      });
      setIsSubmitting(false);
    }, 1500);
  };

  return (
    <div>
      <div className="modal fade" id="newPost" tabIndex={-1} aria-labelledby="exampleModalLabel" aria-hidden="true">
        <div className="modal-dialog">
          <div className="modal-content">
            <div className="modal-header">
              <h1 className="modal-title fs-5" id="exampleModalLabel">Сообщить о находке</h1>
              <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Закрыть" />
            </div>
            <div className="modal-body">
              <form>
                <div className="mb-3">
                  <label htmlFor="location" className="form-label">Место находки:</label>
                  <input 
                    type="text" 
                    className="form-control" 
                    id="location"
                    placeholder="Укажите место, где нашли животное"
                    value={foundAnimalData.location}
                    onChange={(e) => setFoundAnimalData({...foundAnimalData, location: e.target.value})}
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="message-text" className="col-form-label">
                    Введите описание найденного зверька:
                  </label>
                  <textarea 
                    className="form-control" 
                    id="message-text" 
                    rows="4"
                    value={foundAnimalData.description}
                    onChange={(e) => setFoundAnimalData({...foundAnimalData, description: e.target.value})}
                    placeholder="Опишите животное, его поведение, состояние здоровья и т.д."
                  />
                </div>
                <div className="mb-3">
                  <label htmlFor="file" className="col-form-label">Добавьте фото</label><br />
                  <input 
                    type="file" 
                    id="file" 
                    accept="image/*"
                    onChange={handleFileChange}
                  />
                  {foundAnimalData.fileName && (
                    <div className="mt-2">
                      <small>Выбран файл: {foundAnimalData.fileName}</small>
                    </div>
                  )}
                </div>
              </form>
            </div>
            <div className="modal-footer">
              <button type="button" className="btn btn-danger" data-bs-dismiss="modal">Закрыть</button>
              <button 
                type="button" 
                className="btn btn-dark"
                onClick={handleSubmit}
                disabled={isSubmitting}
              >
                {isSubmitting ? "Отправка..." : "Отправить сообщение"}
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Nahodka;
